              <Link to={`/tenant/${tenantid}`}>
                <div className="homeaudit-grid-unresolved" ref={homeAuditGridRef}>
                  <div className="tenantName-gridItem">{tenantName}</div>
                  <div className="btn-homeToTenant">
                    <FaAngleRight />
                  </div>
                </div>
              </Link>
            )}
          </>
        );
      })}
    </div>
  );
}

